import React from "react";

const AboutCard = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        backgroundColor: "white",
        boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
        borderRadius: "16px",
        overflow: "hidden",
        padding: "16px",
        margin: "16px",
      }}
    >
      {/* Video Section */}
      <div style={{ width: "100%", maxWidth: "600px", marginBottom: "16px" }}>
        <video
          style={{
            width: "100%",
            borderRadius: "12px",
          }}
          controls
          poster="https://via.placeholder.com/300"
        >
          <source src="https://www.w3schools.com/html/mov_bbb.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>

      {/* Content Section */}
      <div
        style={{
          width: "100%",
          maxWidth: "600px",
          textAlign: "left",
        }}
      >
        <h2
          style={{
            fontSize: "24px",
            fontWeight: "bold",
            marginBottom: "8px",
            color: "#333",
          }}
        >
          About
        </h2>
        <p
          style={{
            fontSize: "16px",
            lineHeight: "1.6",
            color: "#555",
          }}
        >
          Welcome to our platform! We aim to provide high-quality services and experiences tailored
          just for you. Our team is passionate about delivering excellence in everything we do. Stay
          tuned as we bring more exciting updates your way.
        </p>
      </div>
    </div>
  );
};

export default About;
